const React = require('react');

class Nav extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      isBurgerOpen: false  
    };

    this.handleClick = this.handleClick.bind(this);
  }

  render() {
    return (
      <nav className="navbar is-dark" role="navigation" ariaLabel="main navigation">
      <div className="navbar-brand">
        <a className="navbar-item" href="/">
          <img src="https://cdn.glitch.com/d7caa6e3-7152-40ff-9cce-fd94636631bc%2FUntitled.png?1508555216206"/>
        </a>
        {/* Mobile Only*/}
        <button className={`button navbar-burger`} onClick={this.handleClick}>
          <span></span>
          <span></span>
          <span></span>
        </button>
      </div>
      <div className={`navbar-menu`}>
        <div className="navbar-start">
          <a href="/" className="navbar-item is-active">Home</a>
          <a href="/stuorgs" className="navbar-item">Student Organizations</a>
          <a href="/events" className="navbar-item">Events</a>
        </div>

        <div className="navbar-end">
          <div className="navbar-item has-dropdown is-hoverable">
            <a className="navbar-link">
              User
            </a>

            <div className="navbar-dropdown is-right">
              <a href="/profile" className="navbar-item">
                Profile
              </a>
              <a href="/logout" className="navbar-item">
                Logout
              </a>
            </div>
          </div>
        </div>

      </div>
    </nav>
    );
  }

  handleClick() {
    console.log('Test');
    this.setState({isBurgerOpen: !this.state.isBurgerOpen});
  }
}

module.exports = Nav;
